(915, 133, 'Menegur teman tersebut di grup dan memintanya untuk tidak ikut-ikutan menyebarkan berita hoaks', 0, '2023-07-20 01:25:11', '2023-07-20 01:25:11'),
(916, 132, 'Mengirim seluruh karyawan untuk mengikuti pelatihan tersebut supaya mendapatkan ilmu tersebut', 0, '2023-07-20 01:25:24', '2023-07-20 01:25:24'),
(917, 132, 'Mengirim sebagian karyawan untuk berangkat ke pelatihan tersebut supaya pekerjaan harian tidak terbengkalai', 0, '2023-07-20 01:25:24', '2023-07-20 01:25:24'),
(918, 132, 'Mengirim beberapa perwakilan yang nanti akan saya tugaskan untuk mengajari rekan kerja yang lain', 0, '2023-07-20 01:25:24', '2023-07-20 01:25:24'),
(919, 132, 'Mengirim sedikit saja peserta untuk menghormati perusahaan karena divisi lain juga mengirimkan wakilnya', 0, '2023-07-20 01:25:24', '2023-07-20 01:25:24'),
(920, 132, 'Mengirim karyawan yang potensial untuk mengikuti pelatihan tersebut sehingga bisa mengimplementasikan ilmu yang didapatnya di divisi kami', 0, '2023-07-20 01:25:24', '2023-07-20 01:25:24'),
(921, 131, 'Meminta bantuan teman untuk mengerjakan pekerjaan saya menggunakan software baru tersebut supaya tenggat waktu pekerjaan tidak terlambat', 0, '2023-07-20 01:25:37', '2023-07-20 01:25:37'),
(922, 131, 'Tetap menggunakan laporan biasa sampai saya bisa menggunakan software tersebut, karena laporan keuangan dan gaji harus tepat waktu dan tidak boleh salah', 0, '2023-07-20 01:25:37', '2023-07-20 01:25:37'),
(923, 131, 'Menyediakan waktu ekstra untuk mempelajari software baru agar bisa segera memenuhi anjuran tersebut.', 0, '2023-07-20 01:25:37', '2023-07-20 01:25:37'),
(924, 131, 'Langsung mencoba software baru tersebut meskipun pekerjaan saya harus sedikit terlambat', 0, '2023-07-20 01:25:37', '2023-07-20 01:25:37'),
(925, 131, 'Menghadap atasan dan minta untuk tetap menggunakan system laporan yang lama karena telah terbukti baik', 0, '2023-07-20 01:25:37', '2023-07-20 01:25:37'),
(926, 130, 'Mengolah data mentah tersebut karena jika harus dikembalikan ke desa akan memakan waktu yang cukup lama', 0, '2023-07-20 01:25:53', '2023-07-20 01:25:53'),
(927, 130, 'Mengolah data mentah tersebut untuk bisa dianalisis bersama data lain sebagai suatu kesatuan', 0, '2023-07-20 01:25:53', '2023-07-20 01:25:53'),
(928, 130, 'Menyajikan data mentah tersebut dalam analisa dari data yang lain', 0, '2023-07-20 01:25:53', '2023-07-20 01:25:53'),
(929, 130, 'Memisahkan data tersebut dan tidak memasukkan ke bagian data yang dianalisa', 0, '2023-07-20 01:25:53', '2023-07-20 01:25:53'),
(930, 130, 'Mengembalikan dan meminta desa untuk menyajikan data seperti yang dibutuhkan', 0, '2023-07-20 01:25:53', '2023-07-20 01:25:53'),
(931, 129, 'Mengikuti kegiatan diklat dengan baik dan berusaha mengejar ketertinggalan di perkuliahan', 0, '2023-07-20 01:26:13', '2023-07-20 01:26:13'),
(932, 129, 'Menggunakan waktu satu bulan untuk menyelesaikan tugas-tugas kuliah saya yang tidak bisa saya kerjakan saat saya di karantina nanti', 0, '2023-07-20 01:26:13', '2023-07-20 01:26:13'),
(933, 129, 'Meminta kompensasi untuk boleh keluar dari karantina untuk menyelesaikan kegiatan kuliah saya', 0, '2023-07-20 01:26:13', '2023-07-20 01:26:13'),
(934, 129, 'Terpaksa mengambil cuti kuliah karena menjadi PNS merupakan cita-cita saya, dan diklat ini sangat penting untuk karier saya sebagai PNS', 0, '2023-07-20 01:26:13', '2023-07-20 01:26:13'),
(935, 129, 'Meminta atasan mendahulukan teman kantor lain untuk mengikuti diklat tersebut karena saya sedang mengejar untuk lulus kuliah saya terlebih dahulu.', 0, '2023-07-20 01:26:13', '2023-07-20 01:26:13'),
(936, 128, 'Meminta jadwal ronda pada hari di mana saya tidak sibuk', 0, '2023-07-20 01:26:32', '2023-07-20 01:26:32'),
(937, 128, 'Ikut jadwal ronda di hari yang saya bisa, meskipun bukan jadwal saya', 0, '2023-07-20 01:26:32', '2023-07-20 01:26:32'),
(938, 128, 'Berusaha menepati jadwal ronda yang sudah ditentukan dengan mengatur jadwal harian saya', 0, '2023-07-20 01:26:32', '2023-07-20 01:26:32'),
(939, 128, 'Meminta tetangga untuk menggantikan jadwal saya dan memberinya kompensasi', 0, '2023-07-20 01:26:32', '2023-07-20 01:26:32'),
(940, 128, 'Memilih untuk membayar denda dan tidak mengikuti jadwal ronda siskamling', 0, '2023-07-20 01:26:32', '2023-07-20 01:26:32'),
(941, 127, 'Saya mempelajari tugas tersebut, lalu membagi pengetahuan saya kepada anggota tim yang lain', 0, '2023-07-20 01:26:47', '2023-07-20 01:26:47'),
(942, 127, 'Saya yakin para anggota tim juga dapat belajar sendiri untuk memahami cara menyelesaikan tugas baru tersebut', 0, '2023-07-20 01:26:47', '2023-07-20 01:26:47'),
(943, 127, 'Saya akan meminta bantuan rekan kerja yang paling pandai untuk mempelajari tugas tersebut, kemudian menjelaskannya pada semua anggota tim', 0, '2023-07-20 01:26:47', '2023-07-20 01:26:47'),
(944, 127, 'Kami mengerjakan bersama-sama tugas tersebut sesuai dengan pemahaman kami, bila ada kesulitan kami akan menyelesaikannya dan mencari jalan keluar bersama-sama', 0, '2023-07-20 01:26:47', '2023-07-20 01:26:47'),
(945, 127, 'Pimpinan yang memberikan tugas sebaiknya menjelaskan terlebih dahulu bagaimana mengerjakan tugas tersebut sebaik-baiknya.', 0, '2023-07-20 01:26:47', '2023-07-20 01:26:47'),
(946, 126, 'Meminta bantuan teman lain untuk membantunya menyiapkan bahan presentasi', 0, '2023-07-20 01:27:03', '2023-07-20 01:27:03'),
(947, 126, 'Mementingkan menyelesaikan tugas pribadi, karena saya juga harus mengejar batas waktu', 0, '2023-07-20 01:27:03', '2023-07-20 01:27:03'),
(948, 126, 'Bertanya padanya barangkali ada yang bisa saya lakukan untuk membantunya', 0, '2023-07-20 01:27:03', '2023-07-20 01:27:03'),
(949, 126, 'Menunda sesaat pekerjaan saya untuk membantunya menyiapkan bahan presentasi', 0, '2023-07-20 01:27:03', '2023-07-20 01:27:03'),
(950, 126, 'Menyelesaikan pekerjaan saya secepatnya, supaya bisa membantu menyiapkan bahan presentasi', 0, '2023-07-20 01:27:03', '2023-07-20 01:27:03'),
(951, 125, 'Memberi skorsing kepadanya supaya dia menyadari kesalahannya dan akan mematuhi peraturan', 0, '2023-07-20 01:27:23', '2023-07-20 01:27:23'),
(952, 125, 'Memanggil dan mengingatkan untuk mematuhi peraturan terkait seragam kerja di instansi anda', 0, '2023-07-20 01:27:23', '2023-07-20 01:27:23'),
(953, 125, 'Melaporkan dan meminta kepada pimpinan instansi untuk memberikan pembinaan terhadap pegawai tersebut', 0, '2023-07-20 01:27:23', '2023-07-20 01:27:23'),
(954, 125, 'Membiarkan saja dan membiarkan itu menjadi tanggung jawab pimpinan instansi', 0, '2023-07-20 01:27:23', '2023-07-20 01:27:23'),
(955, 125, 'Mengiriminya surat teguran terkait seragam yang dikenakannya', 0, '2023-07-20 01:27:23', '2023-07-20 01:27:23'),
(956, 124, 'mencoba mencari inovasi dalam penyajian makanan sehingga dapat memberikan pengalaman makan yang tak terlupakan kepada pelanggan', 0, '2023-07-20 01:27:43', '2023-07-20 01:27:43'),
(957, 124, 'menambahkan menu-menu baru untuk semakin meningkatkan minat pelanggan untuk mencobanya', 0, '2023-07-20 01:27:43', '2023-07-20 01:27:43'),
(958, 124, 'membuat penambahan ruang supaya restoran bisa menampung lebih banyak orang lagi', 0, '2023-07-20 01:27:43', '2023-07-20 01:27:43'),
(959, 124, 'mempertahankan kualitas rasa masakan yang telah membuat restoran ini dikenal dan dikunjungi banyak orang', 0, '2023-07-20 01:27:43', '2023-07-20 01:27:43'),
(960, 124, 'memberikan potongan harga pada hari-hari tertentu sebagai ucapan terima kasih untuk pelangan', 0, '2023-07-20 01:27:43', '2023-07-20 01:27:43');
