(124, 1, 2, 23, '<p>Restoran yang anda rintis sejak lama saat ini sudah mulai menampakkan hasilnya dan menjadi salah satu restoran favorit di kota anda. Banyak pengunjung yang datang, baik dari dalam kota maupun luar kota karena ingin mencoba makanan di restoran yang sering membuat restoran penuh dan membuat beberapa tamu menunggu. Melihat keberhasilan ini saya sangat senang dan terus berusaha untuk meningkatkan pelayanan. Hal pertama yang terlintas dalam rencana peningkatan layanan adalah .</p>', '<p><strong>Kunci Jawaban&nbsp;&nbsp;&nbsp;&nbsp;C&nbsp;&nbsp;&nbsp; B&nbsp;&nbsp;&nbsp;&nbsp;A&nbsp;&nbsp;&nbsp;&nbsp;E&nbsp;&nbsp;&nbsp;&nbsp;D</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a3,b4,c5,d1,e2', '2023-07-19 22:05:26', '2023-07-20 01:27:43'),
(125, 1, 2, 24, '<p>Anda merupakan kepala bagian kepegawaian di sebuah instansi. Suatu hari salah seorang pegawai mengenakan seragam yang sudah dimodifikasi sehingga lebih sesuai dengan pemahaman agama yang diyakini. Permasalahannya bentuk seragam tidak sesuai dengan peraturan tentang seragam pegawai di instansi tempat anda bekerja. Anda akan .</p>', '<p><strong>Kunci Jawaban&nbsp;&nbsp;&nbsp;&nbsp;B&nbsp;&nbsp;&nbsp;&nbsp;E&nbsp;&nbsp;&nbsp;&nbsp;A&nbsp;&nbsp;&nbsp;&nbsp;C&nbsp;&nbsp;&nbsp;&nbsp;D</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a3,b5,c2,d1,e4', '2023-07-19 22:11:04', '2023-07-20 01:27:23'),
(126, 1, 2, 23, '<p>Pada suatu waktu rekan kerja saya kesulitan menyiapkan bahan presentasi, padahal lima menit lagi dia harus&nbsp; mempresentasikan hasil pekerjaan di hadapan para atasan. Pada waktu itu saya sedang dalam kondisi sibuk dengan pekerjaan saya. Yang saya lakukan adalah .</p>', '<p><strong>Kunci Jawaban: DCEAB</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a2,b1,c4,d5,e3', '2023-07-19 22:13:27', '2023-07-20 01:27:03'),
(127, 1, 2, 24, '<p>Pimpinan memberikan tugas baru kepada anda dan tim anda. Tugas tersebut merupakan tugas yang baru dan belum pernah anda kerjakan sebelumnya. Begitu juga dengan rekan tim yang lain, mereka merasa kebingungan dan belum memahami maksud dan cara mengerjakan tugas baru tersebut. Sikap anda .</p>', '<p>Kunci Jawaban: DACEB</p><p>Pembahasan cek dikelas zoom</p>', 'a4,b1,c3,d5,e2', '2023-07-19 22:21:15', '2023-07-20 01:26:47'),
(128, 1, 2, 27, '<p>Warga perumahan di tempat anda sepakat untuk mengadakan ronda siskamling secara bergiliran. Sementara jadwal harian anda sangat padat dan terkadang sampai rumah larut malam. Anda akan .</p>', '<p><strong>Kunci Jawaban: CABDE</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a4,b3,c5,d2,e1', '2023-07-19 22:23:20', '2023-07-20 01:26:32'),
(129, 1, 2, 24, '<p>Saya baru saja diterima menjadi seorang Pegawai Negeri Sipil. Bulan depan akan dilaksanakan diklat dan harus dikarantina selama dua bulan. Sementara di sisi lain, saya juga akan memasuki bulan-bulan akhir kuliah pascasarjana yang sudah saya tempuh jauh sebelum diterima sebagai PNS. Saya akan .</p>', '<p><strong>Kunci Jawaban: BDACE</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a3,b5,c2,d4,e1', '2023-07-19 22:25:49', '2023-07-20 01:26:13'),
(130, 1, 2, 23, '<p>Sebagai seorang analisis data di sebuah instansi pemerintah daerah, tugas saya adalah mengumpulkan, dan menganalisa data dari seluruh desa di kabupaten. Seluruh desa sudah mendapatkan pelatihan tentang pengumpulan dan penyajian data untuk pemerintah daerah. Namun ada beberapa desa yang memberikan saya data mentah yang belum diolah. Saya akan </p>', '<p><strong>Kunci Jawaban: EBACD</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a3,b4,c2,d1,e5', '2023-07-19 22:42:48', '2023-07-20 01:25:53'),
(131, 1, 2, 24, '<p>Sebagai seorang bendahara gaji di sebuah instansi, saya dituntut untuk bekerja dengan cepat dan teliti. Sejauh ini saya dapat memenuhi semua tuntutan pekerjaan dengan baik, sampai datang sebuah keputusan bahwa semua laporan gaji dan keuangan dianjurkan menggunakan sebuah software baru yang tidak saya kuasai sama sekali. Saya akan .</p>', '<p><strong>Kunci Jawaban: CBADE</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a3,b4,c5,d2,e1', '2023-07-19 22:44:20', '2023-07-20 01:25:37'),
(132, 1, 2, 23, '<p>Perusahaan mengadakan pelatihan terkait peningkatan kualitas sumber daya manusia dalam penggunaan teknologi dan informasi di era digital. Sebagai kepala divisi saya akan</p>', '<p><strong>Kunci Jawaban: CEBAD</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a2,b3,c5,d1,e4', '2023-07-19 22:45:58', '2023-07-20 01:25:24'),
(133, 1, 2, 24, '<p>Dalam sebuah grup alumni sekolah, seorang teman mengirimkan sebuah pesan berita yang mendiskreditkan pemerintah. Saya yang mengetahui bahwa berita tersebut merupakan berita hoaks yang sangat jauh dari kenyataan sebenarnya. Saya akan .</p>', '<p><strong>Kunci Jawaban: BACED</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a4,b5,c3,d1,e2', '2023-07-19 22:47:35', '2023-07-20 01:25:11'),
(134, 1, 2, 24, '<p>Seorang warga baru datang dan mengontrak rumah di sebelah rumah anda. Ternyata dalam pergaulan social dia sangat tertutup dan tidak bergaul dengan tetangga. Berdasarkan pengamatan, Anda mencurigai dia terkait dengan salah satu paham radikal. Yang anda lakukan adalah .</p>', '<p><strong>Kunci Jawaban: BACED</strong></p><p>Pembahasan cek dikelas zoom</p>', 'a4,b5,c3,d1,e2', '2023-07-19 22:50:13', '2023-07-20 01:24:56');
